import React, { Component } from "react";
import Header from "./Header";
import Products from "./products.js"

import "./App.css";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <div className="App-main">List of Scooters Goes Here</div>
      </div>
    );
  }
}

export default App;
